script: |
  super -f tsv -I q9621.sql | sort > q9621.out

vector: true

inputs:
  - name: q9621.sql
    data: |
      SELECT ALL - 49 FROM tab0 WHERE NOT - col2 NOT BETWEEN ( + col0 * - 38 + - 57 ) AND + CAST ( - col2 AS INTEGER ) + + col1;
  - name: tab0

outputs:
  - name: q9621.out
    data: |
      -49
      -49
      -49
